import re

def count_html_tags(html_snippet: str) -> dict:
    tag_counts = {}
    tags = re.findall('', html_snippet)
    for tag in tags:
        tag = tag.lower()
        tag_counts[tag] = tag_counts.get(tag, 0) + 1
    return tag_counts

